import React from 'react'
import { ArrowRight, SortUp } from 'react-bootstrap-icons'

export default function ({ columns, onSort, sortColumn }) {
  return (
    <thead>
      {columns.map((column) => (
        <th
          key={column.path}
          className="clickable"
          onClick={() => onSort(column.path)}
        >
          {column.lable}
        </th>
      ))}
    </thead>
  )
}
